import React, { Component } from 'react';
import './App.css';
import ContactList from './components/ContactList';
import AddContact from './components/AddContact';
import Main from './components/Main';


class App extends Component {
    render(){
        return(
        <div >
          <Main/>
          <AddContact />
          <ContactList />
      </div>
    )
    }
}

export default App;
